import cssClasses from './ListUser.module.css';

const ListUser = props => {
    const classes = `${cssClasses.user} ${props.className}`

    return (
        <ul className={classes}>
            <div>{props.username}</div>
            <div>{props.age}</div>
        </ul>
    )
};

export default ListUser;
